import Card from './ProjectCard';

const aboutStyle = `
.about-container {
  margin-top: 100px;
}

.cards-container {
  display: flex;
  justify-content: space-evenly;
}
`;

const About = () => {
  return (
    <div className="about-container">
      <h1>About Me</h1>
      <div className="cards-container">
        {[1,2,3].map((card) => (
          <Card/>
          ))}
        <style>{aboutStyle}</style>
      </div>
    </div>

  );
};

export default About;
